import React, { useState } from "react";
import { NavLink } from "react-router-dom";

function SideNavbar() {
    const [isOpen, setOpen] = useState(false);
    return(
        <ul className="navbar-nav bg-gradient-primary sidebar sidebar-dark accordion" itemID="accordionSidebar">

            <a className="sidebar-brand d-flex align-items-center justify-content-center" to="/dashboard">
                <div className="sidebar-brand-icon rotate-n-15">
                    <i className="fas fa-laugh-wink"></i>
                </div>
                <div className="sidebar-brand-text mx-3">SB Admin <sup>2</sup></div>
            </a>

            <hr className="sidebar-divider my-0"/>

            <li className="nav-item">
                <a className="nav-link" to="/dashboard">
                    <i className="fas fa-fw fa-tachometer-alt"></i>
                    <span>Dashboard</span>
                </a>
            </li>
        </ul>
    )
}

export default SideNavbar;
